func getAllGPSFileSources(folder string) ([]string, error) {
	exp, err := util.ListDir(path.Join(ctr.Config.Data, folder, "gps_trajectories"))
	if err != nil {
		return nil, err
	}
	ret := make([]string, 0, len(exp))
	for _, n := range exp {
		if !strings.HasPrefix(n, ".") {
			ret = append(ret, n)
		}
	}
	return ret, nil
}

func getAllExperiments() ([]*mod.ExperimentMeta, error) {
	exp, err := util.ListDir(ctr.Config.Experiments)
	if err != nil {
		return nil, err
	}
	ret := make([]*mod.ExperimentMeta, 0, len(exp))
	for _, n := range exp {
		metaStr, err := ioutil.ReadFile(
			path.Join(ctr.Config.Experiments, n, "meta.json"),
		)
		if err == nil {
			var meta mod.ExperimentMeta
			if err := json.Unmarshal(metaStr, &meta); err == nil {
				ret = append(ret, &meta)
			}
		}
	}
	sort.Slice(ret, func(i, j int) bool {
		return ret[i].CreationTime > ret[j].CreationTime
	})
	return ret, nil
}

func getExperimentByID(id int) (*mod.ExperimentMeta, error) {
	expList, err := getAllExperiments()
	if err != nil {
		return nil, err
	}
	for _, e := range expList {
		if e.ID == id {
			return e, nil
		}
	}
	return nil, nil
}

func createExperiment(
	name string,
	image interface{},
) (*mod.ExperimentMeta, error) {
	exp, err := getAllExperiments()
	if err != nil {
		return nil, err
	}

	// Get new experiment ID.
	id := 0
	for _, e := range exp {
		if e.ID+1 > id {
			id = e.ID + 1
		}
	}

	img := defaultImage
	if image != nil {
		img = image.(string)
	}

	ret := mod.ExperimentMeta{
		ID:           id,
		Name:         name,
		Image:        img,
		CreationTime: int(time.Now().Unix()),
	}

	f := path.Join(ctr.Config.Experiments, "Experiment_"+strconv.Itoa(id))
	if err := os.MkdirAll(f, 0755); err != nil {
		return nil, err
	}

	c, err := json.Marshal(ret)
	if err != nil {
		return nil, err
	}

	if err := ioutil.WriteFile(path.Join(f, "meta.json"), c, 0755); err != nil {
		return nil, err
	}

	return &ret, nil
}

func deleteExperiment(id string) error {
	exp, err := util.ListDir(ctr.Config.Experiments)
	if err != nil {
		return err
	}

	for _, n := range exp {
		metaStr, err := ioutil.ReadFile(
			path.Join(ctr.Config.Experiments, n, "meta.json"),
		)
		if err == nil {
			var meta mod.ExperimentMeta
			if err := json.Unmarshal(metaStr, &meta); err == nil {
				if strconv.Itoa(meta.ID) == id {
					if err := os.RemoveAll(
						path.Join(ctr.Config.Experiments, n),
					); err != nil {
						return err
					}
					break
				}
			}
		}
	}

	return nil
}

func resetRoadnet(id int) error {
	em := ""

	exp := path.Join(ctr.Config.Experiments, "Experiment_"+strconv.Itoa(id))

	// Remove binaries.
	// TODO: remove other binaries.
	bins := [2]string{
		"road_network.bin",
		"grid_index.bin",
	}
	for _, bin := range bins {
		if err := util.RemoveFile(path.Join(exp, bin)); err != nil {
			em += err.Error() + ";"
		}
	}

	if em == "" {
		return nil
	}
	return fmt.Errorf(em)
}

